   "source": [
    "function birthday_problem_1(n)\n",
    "    success = 0\n",
    "    for t in 1:n\n",
    "        months = rand(1:12,20)\n",
    "        counts = [sum(months.==i) for i in 1:12]\n",
    "        success += sum(counts.==2) == 4 && sum(counts.==3) == 4\n",
    "    end\n",
    "    success/n\n",
    "end"
   ]
  },
