   "source": [
    "function birthday_distribution(t)\n",
    "    v = zeros(t)\n",
    "    for i = 1:t\n",
    "        v[i] = birthday_problem_floop(1_000_000,16)\n",
    "    end\n",
    "    h = fit(Histogram,v,0.0005:0.00001:0.0015)\n",
    "end"
   ]
